_type":"display_data","data":{"text/plain":"K-means clustering with 6 clusters of sizes 45, 21, 35, 39, 38, 22\n\nCluster means:\n       Age Annual.Income..k.. Spending.Score..1.100.\n1 56.15556           53.37778               49.08889\n2 44.14286           25.14286               19.52381\n3 41.68571           88.22857               17.28571\n4 32.69231           86.53846               82.12821\n5 27.00000           56.65789               49.13158\n6 25.27273           25.72727               79.36364\n\nClustering vector:\n  [1] 2 6 2 6 2 6 2 6 2 6 2 6 2 6 2 6 2 6 2 6 2 6 2 6 2 6 2 6 2 6 2 6 2 6 2 6 2\n [38] 6 2 6 1 6 1 5 2 6 1 5 5 5 1 5 5 1 1 1 1 1 5 1 1 5 1 1 1 5 1 1 5 5 1 1 1 1\n [75] 1 5 1 5 5 1 1 5 1 1 5 1 1 5 5 1 1 5 1 5 5 5 1 5 1 5 5 1 1 5 1 5 1 1 1 1 1\n[112] 5 5 5 5 5 1 1 1 1 5 5 5 4 5 4 3 4 3 4 3 4 5 4 3 4 3 4 3 4 3 4 5 4 3 4 3 4\n[149] 3 4 3 4 3 4 3 4 3 4 3 4 3 4 3 4 3 4 3 4 3 4 3 4 3 4 3 4 3 4 3 4 3 4 3 4 3\n[186] 4 3 4 3 4 3 4 3 4 3 4 3 4 3 4\n\nWithin cluster sum of squares by cluster:\n[1]  8062.133  7732.381 16690.857 13972.359  7742.895  4099.818\n (between_SS / total_SS =  81.1 %)\n\nAvailable components:\n\n[1] \"cluster\"      \"centers\"      \"totss\"        \"withinss\"     \"tot.withinss\"\n[6] \"betweenss\"    \"size\"         \"iter\"         \"ifault\"      "},"metadata":{}}]},{"cell_type":"markdown","source":"### We see several expressions in the output of the k-means operation, from which we can conclude useful information:\n- cluster – This is a vector of several integers that denote the cluster which has an allocation of each point.\n- totss – This represents the total sum of squares.\n- centers – Matrix comprising of several cluster centers\n- withinss – This is a vector representing the intra-cluster sum of squares having one component per cluster.\n- tot.withinss – This denotes the total intra-cluster sum of squares.\n- betweenss – This is the sum of between-cluster squares.\n- size – The total number of points that each cluster ho