ers with a medium PCA1 and a low PCA2 score.\n\n- Cluster 3 – This cluster comprises of customers with a high PCA1 income and a high PCA2.\n\n- Cluster 2 – This comprises of customers with a high PCA2 and a medium annual spend of income.","metadata":{}},{"cell_type":"markdown","source":"# Summary\n- With the help of clustering, we can understand the variables much better, prompting us to take careful decisions. With the identification of customers, companies can release products and services that target customers based on several parameters like income, age, spending patterns, etc. Furthermore, more complex patterns like product reviews are taken into consideration for better segmentation.","metadata":{}}]}